"""
Tests for edly_api serializers.
"""
from django.test import TestCase

from credentials.apps.catalog.tests.factories import ProgramFactory
from credentials.apps.core.tests.mixins import SiteMixin
from credentials.apps.credentials.tests.factories import SignatoryFactory, ProgramCertificateFactory
from credentials.apps.edx_credentials_extensions.edly_credentials_app.api.serializers import SignatorySerializer, ProgramCertificateConfigurationSerializer


class SignatorySerializerTest(SiteMixin, TestCase):
    """
    Tests for Signatory Serializer.
    """

    def setUp(self):
        super(SignatorySerializerTest, self).setUp()
        self.serializer = SignatorySerializer
        self.test_data = {
            "name": "Jhon Doe",
            "title": "Director Certificates",
            "image": "data:image/png;base64,"
        }

    def test_create_signatory(self):
        """
        Verify creation data.
        """
        serializer = self.serializer(data=self.test_data)
        assert serializer.is_valid(raise_exception=True)

    def test_update_signatory(self):
        """
        Verify update data.
        """
        signatory = SignatoryFactory()
        self.test_data['id'] = signatory.id
        serializer = self.serializer(data=self.test_data)
        assert serializer.is_valid(raise_exception=True)


class ProgramCertificateConfigurationSerializerTest(SiteMixin, TestCase):
    """
    Tests for Program Certificate Configuration Serializer.
    """

    def setUp(self):
        super(ProgramCertificateConfigurationSerializerTest, self).setUp()
        self.serializer = ProgramCertificateConfigurationSerializer

        program = ProgramFactory(site=self.site)
        self.test_data = {
            "site": self.site.domain,
            "is_active": True,
            "signatories": [
                {
                    "name": "Jhon Doe",
                    "title": "Director Certificates",
                    "image": "data:image/png;base64,"
                }
            ],
            "program_uuid": str(program.uuid),
            "use_org_name": True,
            "include_hours_of_effort": True,
            "language": "en"
        }

    def test_create_program_certificate_configuration(self):
        """
        Verify creation data.
        """
        serializer = self.serializer(data=self.test_data)
        assert serializer.is_valid(raise_exception=True)

    def test_update_program_certificate_configuration(self):
        """
        Verify update data.
        """
        test_data = self.test_data
        test_data['signatories'] = []
        test_data['is_active'] = False

        serializer = self.serializer(data=test_data)
        assert serializer.is_valid(raise_exception=True)
